import Card from '../Card'

stocks = [{ name: 'GME' }, { name: 'TSLA' }, { name: 'AAPL' }, { name: 'AMC' }]

export default function Watchlist() {
    return (
        <main className="watchlist">
            <Container>
                <h1>ToTheM00n Watchlist üíé üëê üíé üëê üíé üëê üíé üëêüíé</h1>
                {stocks.map((stock) => (
                    <article className="list-item" key={value.toString()}>
                        <Card stock={stock} />
                        {/* stockName={stockName}  */}
                    </article>
                ))}
            </Container>
        </main>
    )
}
